import React, { useState } from 'react';
import { Card, Row, Col, Statistic, Button, message, Upload } from 'antd';
import { ExperimentOutlined, FileTextOutlined, SettingOutlined, ApiOutlined, UploadOutlined } from '@ant-design/icons';
import type { UploadFile, UploadProps } from 'antd/es/upload/interface';

const Home: React.FC = () => {
  const [backendMessage, setBackendMessage] = useState<string>('未连接');
  const [fileList, setFileList] = useState<UploadFile[]>([]);
  const [currentJsonFile, setCurrentJsonFile] = useState<string>('未上传');

  const testBackendConnection = async () => {
    try {
      const response = await fetch('/api/test'); // 假设后端运行在相同域名和端口
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setBackendMessage(data.message);
      message.success('后端连接成功！');
    } catch (error) {
      console.error('Error testing backend connection:', error);
      setBackendMessage('连接失败');
      message.error('后端连接失败！请检查后端服务是否已启动。');
    }
  };

  const uploadProps: UploadProps = {
    name: 'file',
    action: '/api/upload-tag-json', // 后端文件上传接口
    headers: { // 可以根据需要添加认证头等
      // authorization: 'authorization-text',
    },
    accept: '.json',
    maxCount: 1,
    fileList: fileList,
    onChange(info) {
      let newFileList = [...info.fileList];

      // 1. Limit the number of uploaded files
      // Only show the last uploaded file, and disable future uploads if more than one is selected
      newFileList = newFileList.slice(-1);

      // 2. Read from response and show file link
      newFileList = newFileList.map((file) => {
        if (file.response) {
          if (file.response.message === "文件上传成功，已设置为当前训练参数文件！") {
            message.success(`${file.name} 文件上传成功，已设置为当前训练参数文件！`);
            setCurrentJsonFile(file.response.filename);
          } else {
            message.error(`${file.name} 文件上传失败：${file.response.detail || file.response.message}`);
          }
        }
        return file;
      });

      setFileList(newFileList);

      if (info.file.status === 'done') {
        // 已经在 map 中处理了成功/失败消息
      } else if (info.file.status === 'error') {
        message.error(`${info.file.name} 文件上传失败。`);
      }
    },
    onRemove: (file) => {
      const index = fileList.indexOf(file);
      const newFileList = fileList.slice();
      newFileList.splice(index, 1);
      setFileList(newFileList);
      setCurrentJsonFile('未上传');
      message.info(`已移除文件: ${file.name}`);
    },
  };

  return (
    <div>
      <h1>参数拟合工具</h1>
      <Row gutter={16}>
        <Col span={8}>
          <Card>
            <Statistic
              title="已训练参数"
              value={0}
              prefix={<ExperimentOutlined />}
            />
          </Card>
        </Col>
        <Col span={8}>
          <Card>
            <Statistic
              title="数据集数量"
              value={0}
              prefix={<FileTextOutlined />}
            />
          </Card>
        </Col>
        <Col span={8}>
          <Card>
            <Statistic
              title="配置项"
              value={0}
              prefix={<SettingOutlined />}
            />
          </Card>
        </Col>
      </Row>
      <div style={{ marginTop: '20px', textAlign: 'center' }}>
        <Button
          type="primary"
          icon={<ApiOutlined />}
          onClick={testBackendConnection}
          style={{ marginRight: '20px' }}
        >
          测试后端连接
        </Button>
        <p style={{ marginTop: '10px' }}>后端状态: {backendMessage}</p>
      </div>

      <div style={{ marginTop: '40px', textAlign: 'center' }}>
        <h2>训练参数文件管理</h2>
        <Upload {...uploadProps}>
          <Button icon={<UploadOutlined />}>上传 Tag.json 文件 (每次仅一个)</Button>
        </Upload>
        <p style={{ marginTop: '10px' }}>当前活跃的参数文件: {currentJsonFile}</p>
      </div>
    </div>
  );
};

export default Home;
